import Vue from "vue";
import Router from "vue-router";
import UserSignUp from "@/components/UserSignUp";
import IdealVacation from "@/components/IdealVacation";

Vue.use(Router);

export default new Router({
  mode: "history",
  routes: [
    {
      path: "/",
      name: "UserSignUp",
      component: UserSignUp,
    },
    {
      path: "/ideal-vacation",
      name: "IdealVacation",
      component: IdealVacation,
    },
  ],
});
